theme_mods.custom_css_string:
/* header-logo-width 
=========================*/
.aux-logo-header .aux-logo-anchor{ max-width:80px; }
/* header-logo-max-height-type 
=========================*/
.aux-logo-header .aux-logo-anchor > img { max-height:85px; }
/* site-frame-background-color 
=========================*/
@media screen and (min-width: 700px) { .aux-framed .aux-side-frames, body.aux-framed:after,
            .aux-framed .aux-side-frames:before, .aux-framed .aux-side-frames:after{ background-color:#111111; } }
/* sticky-header-color 
=========================*/
.site-header-section.aux-sticky, .aux-elementor-header.aux-sticky { background-color:#FFFFFF; }
/* site-header-container-scaled-height 
=========================*/
.aux-top-sticky .site-header-section.aux-sticky .aux-fill .aux-menu-depth-0 > .aux-item-content, .aux-top-sticky .site-header-section.aux-sticky .aux-header-elements,.aux-elementor-header.aux-sticky { height:80px; }
/* site-header-container-height 
=========================*/
.site-header-section .aux-header-elements:not(.aux-vertical-menu-elements), .site-header-section .aux-fill .aux-menu-depth-0 > .aux-item-content { height:85px; }
/* site-transparent-header-bgcolor 
=========================*/
.site-header-section { background-color:#FFFFFF; }
/* site-vertical-menu-background-color 
=========================*/
.aux-vertical-menu-side  { background-color:#FFF; }
/* site-header-navigation-item-height 
=========================*/
.site-header-section .aux-middle .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-mobile-header-toggle-button-color 
=========================*/
.site-header-section .aux-header .aux-burger:before, .site-header-section .aux-header .aux-burger:after, .site-header-section .aux-header .aux-burger .mid-line{ border-color:#3d3d3d; }
/* site-menu-full-screen-background-color 
=========================*/
#fs-menu-search:before { background-color:rgba(255, 255, 255, 0.95); }
/* site-top-header-background-color 
=========================*/
#top-header{background-color:#FFFFFF;}
/* blog-post-like-icon-size 
=========================*/
.single-post .wp_ulike_general_class .wp_ulike_btn:before { font-size:36px; }
/* blog-post-share-button-icon-size 
=========================*/
.single-post .aux-single-post-share span::before { font-size:30px; }
/* post-title-bar-overlay-pattern-opacity 
=========================*/
.single-post .aux-overlay-bg-hash::before { opacity:0.15; }
/* page-title-bar-overlay-pattern-opacity 
=========================*/
.page .aux-overlay-bg-hash::before { opacity:0.5; }
/* subfooter-bar-layout-bg-color 
=========================*/
.aux-subfooter-bar { background-color:#fafafa; }
/* subfooter-bar-top-border-color 
=========================*/
.aux-subfooter-bar { border-top:1px solid #EAEAEA; }
/* subfooter-layout-bg-image-position 
=========================*/
.aux-subfooter{background-position:center center;}
/* subfooter-layout-bg-image-size 
=========================*/
.aux-subfooter{background-size:cover;}
/* subfooter-layout-bg-image-repeat 
=========================*/
.aux-subfooter{background-repeat:no-repeat;}
/* subfooter-top-border-color 
=========================*/
.aux-subfooter { border-top:1px solid #EAEAEA; }
/* site-footer-bg-color 
=========================*/
.aux-site-footer{background-color:#1A1A1A;}
/* footer-top-border-color 
=========================*/
.aux-site-footer{border-top:1px solid #EAEAEA;}
/* footer-top-border-width 
=========================*/
.aux-site-footer { border-top-width:1px; }
/* site-secondary-logo-max-height 
=========================*/
.aux-logo-footer .aux-logo-anchor img { max-height:50px; }
/* site-featured-color-1 
=========================*/
:root{--auxin-featured-color-1: #1e3c72;}
/* site-featured-color-2 
=========================*/
:root{--auxin-featured-color-2: #2d2d2d;}
/* site-featured-color-3 
=========================*/
:root{--auxin-featured-color-3: #fee7cd;}
/* general-heading-h1 
=========================*/
body h1, body .aux-h1{ font-family:'Playfair Display'; } 
/* general-heading-h2 
=========================*/
body h2, body .aux-h2{ font-family:'Playfair Display'; } 
/* general-heading-h3 
=========================*/
body h3, body .aux-h3{ font-family:'Playfair Display'; } 
/* general-heading-h4 
=========================*/
body h4, body .aux-h4{ font-family:'Playfair Display'; } 
/* body-typography 
=========================*/
body{ font-family:'Quicksand'; } 
/* general-heading-h5 
=========================*/
body h5, body .aux-h5{ font-family:'Quicksand'; } 
/* page-title--typography 
=========================*/
.page-title{ color:rgb(254, 231, 205); font-size:62px; font-weight:bold; line-height:1.4em; } 
@media(max-width: 1024px){ .page-title{ font-size:40px; }  } 
/* page-title-breadcrumb-typography 
=========================*/
.aux-breadcrumbs{ color:rgb(254, 231, 205); font-size:16px; font-weight:400; text-transform:uppercase; letter-spacing:6.65px; line-height:1.5em; } 
@media(max-width: 1024px){ .aux-breadcrumbs{ font-size:13px; }  } 
/* page-title-breadcrumb-link-typography 
=========================*/
.page-title-section .aux-breadcrumbs a{ color:rgb(254, 231, 205); font-size:16px; font-weight:400; text-transform:uppercase; line-height:1.5em; letter-spacing:6.56px; } 
@media(max-width: 1024px){ .page-title-section .aux-breadcrumbs a{ font-size:13px; }  } 
/* single-post-title-typography 
=========================*/
.single-post .aux-primary .hentry .entry-title{ color:rgb(30, 60, 114); font-size:50px; } 
@media(max-width: 1024px){ .single-post .aux-primary .hentry .entry-title{ font-size:40px; }  } 
@media(max-width: 768px){ .single-post .aux-primary .hentry .entry-title{ font-size:30px; }  } 
/* single-post-content-typography 
=========================*/
.single-post .hentry .entry-content{ color:rgb(45, 45, 45); font-size:16px; font-weight:400; line-height:1.5em; letter-spacing:0.48px; } 
@media(max-width: 1024px){ .single-post .hentry .entry-content{ font-size:14px; }  } 
@media(max-width: 768px){ .single-post .hentry .entry-content{ font-size:14px; }  } 
/* single-post-info-typography 
=========================*/
.single-post .hentry .entry-info{ color:rgb(45, 45, 45); font-size:16px; font-weight:400; text-transform:uppercase; line-height:1.4em; } 
@media(max-width: 1024px){ .single-post .hentry .entry-info{ font-size:14px; }  } 
@media(max-width: 768px){ .single-post .hentry .entry-info{ font-size:14px; }  } 
/* single-post-info-terms-typography 
=========================*/
.single-post .hentry .entry-info a{ color:rgb(45, 45, 45); font-size:16px; font-weight:400; line-height:1.5em; } 
@media(max-width: 1024px){ .single-post .hentry .entry-info a{ font-size:14px; }  } 
/* blog-post-like-margin 
=========================*/
.single-post .wp_ulike_general_class button{ margin: 0px 15px 0px 15px } 
/* blog-post-share-button-margin 
=========================*/
.single-post .aux-single-post-share{ margin: 0px 0px 0px 0px } 
/* single-post-meta-typography 
=========================*/
.single-post .hentry footer.entry-meta .entry-tax{ font-family:'Raleway'; color:rgb(32, 32, 32); font-size:27px; font-weight:600; font-style:normal; line-height:1.4em; } 
@media(max-width: 1024px){ .single-post .hentry footer.entry-meta .entry-tax{ font-size:20px; }  } 
/* single-post-meta-terms-typography 
=========================*/
.single-post .hentry footer.entry-meta .entry-tax a, .single-post .hentry footer.entry-meta .entry-tax i{ font-family:'Raleway'; color:rgb(30, 60, 114); font-size:27px; font-weight:600; text-decoration:none; line-height:1.5em; } 
@media(max-width: 1024px){ .single-post .hentry footer.entry-meta .entry-tax a, .single-post .hentry footer.entry-meta .entry-tax i{ font-size:20px; }  } 
/* comment-forms-replay-title-typo 
=========================*/
#reply-title > span{ color:rgb(16, 16, 16); font-size:36px; font-weight:bold; line-height:1.4em; letter-spacing:0.72px; } 
/* comment-forms-button-typo 
=========================*/
#commentform .form-submit input[type="submit"]{ font-family:'Playfair Display'; color:rgb(30, 60, 114); font-size:16px; font-weight:bold; text-transform:uppercase; line-height:1.4em; } 
/* comment-forms-placeholder-typo 
=========================*/
#commentform input::placeholder, #commentform textarea::placeholder{ color:rgb(35, 35, 35); font-size:18px; font-weight:400; font-style:normal; line-height:1.4em; } 
/* comment-content-typo 
=========================*/
.aux-commentlist .comment .comment-body{ font-size:18px; } 
/* blog-post-share-button-icon-color 
=========================*/
.single-post .aux-single-post-share span::before { color:#ffffff; }
/* blog-post-like-icon-color 
=========================*/
.single-post .wp_ulike_btn:before, .single-post .wp_ulike_is_liked .wp_ulike_btn:before { color:#fee7cd; }
/* blog-post-not-like-icon-color 
=========================*/
.single-post .wp_ulike_is_unliked .wp_ulike_btn:before { color:#fee7cd; }

